contract SIMDepositRelease {

	address st;
	address storageAddress;
	uint256 balance;
    mapping( address => uint256 ) log;
    bool latest;

    function() payable {

    }

    function SIMDepositRelease(address _st, address _storageAddress) {
    	st = _st;
    	storageAddress = _storageAddress;
    }

    function callTransferFrom(address _sender, address _receiver, uint256 _amount) returns (bool) {
    	// return st.transfer(_receiver, _amount);
    	return st.call(bytes4(keccak256("transferFrom(address,address,uint256)")), _sender, _receiver, _amount);
    }

	function deposit(uint256 _amount) public payable {

        uint256 amount = _amount * 10 ** 18;

    	log[msg.sender] += amount;
    	balance += amount;

    	callTransferFrom(msg.sender, storageAddress, amount);
	}

	function transfer(address _sender, address _receiver, uint256 _amount) public payable {

		uint256 amount = _amount * 10 ** 18;
		require(log[_sender] > 0 || log[_sender] >= amount);

		log[_sender] -= amount; 
		balance -= amount;

		callTransferFrom(msg.sender, _receiver, amount);
	}

	function getBalance(address _sender) public view returns (uint256){
		return log[_sender];
	}

	function getLatestResult() public view returns (bool) {
		return latest;
	}

	function getStorageAddress() public view returns (address) {
		return storageAddress;
	}
}
